__NUXT_JSONP__("/svet/stat/faerske-ostrovy/retezce", (function(a,b,c,d,e,f,g,h,i,j){return {data:[{tabsLoad:{tabWhatToSee:c,tabPrice:c,tabPeople:c,tabTrip:c,tabContact:c,tabHotel:c,tabNeighboring:false,tabVideos:f,tabArticles:f,tabWallSockets:d,tabChains:f},place:[{tld:".fo",name:"Faerské ostrovy",area:1399,population:48863,slug:h,id_continent:d,information_chatgpt:"\u003Cp\u003EFaerské ostrovy jsou malý ostrovní stát nacházející se mezi Norskem a Islandem v Atlantském oceánu. Tvoří je 18 ostrovů a mají rozlohu pouze 1 399 km². Hlavním městem a největším městem je Tórshavn, který se nachází na ostrově Streymoy. Ostrovy jsou známé svou krásnou přírodou, především fjordy, vodopády a horské vrcholy.\u003C\u002Fp\u003E\n\u003Cp\u003EFaerské ostrovy nabízejí mnoho možností pro turisty, kteří si chtějí užít krásy přírody. Oblast je velmi oblíbená mezi turisty, kteří hledají odpočinek od městského života a chtějí se vrátit k přírodě. Návštěvníci mohou vyzkoušet různé outdoorové aktivity jako jsou pěší túry, cyklistiku, rybaření nebo plavání.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě přírodních krás jsou Faerské ostrovy také známé pro své kulturní dědictví. Tórshavn má mnoho historických budov a muzeí, kde návštěvníci mohou zjistit více o historii a kultuře ostrovů. Místní obyvatelé se také pyšní svými tradičními tanci a písněmi, které jsou vystupovány při mnoha kulturních akcích a slavnostech.\u003C\u002Fp\u003E\n\u003Cp\u003EPro cestování po Faerských ostrovech je nejlepší způsob dopravy autem, protože to umožňuje návštěvníkům pohodlně se dostat na většinu míst ostrovů. Turisté si mohou také pronajmout lodě nebo jet na výlety lodí, aby si užili scenérie z blízka.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité mít na paměti, že Faerské ostrovy jsou poměrně odlehlou oblastí, a proto se turisté musí připravit na omezené možnosti ubytování a služeb. Nicméně, pro ty, kteří hledají klid a přírodu, jsou Faerské ostrovy skvělým místem pro návštěvu.\u003C\u002Fp\u003E",currency_code:"DKK",currency_name:"dánská koruna",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:e,date_update:b},{name:"Policie",value:e,date_update:b},{name:"Hasiči",value:e,date_update:b},{name:"Zdravotnická záchranná služba",value:e,date_update:b}],phone_prefix:"+298",coordinates:[{latitude:"62.0097",longitude:"-6.7716"}],people_religion:[{name:"Luterská církev Faerských ostrovů",value:"80%"},{name:"Ostatní křesťané",value:"9%"},{name:"Bez vyznání",value:"6%"},{name:"Neuvedeno",value:"5%"}],people_nationality:[{name:"Faerané",value:"98.5%"},{name:"jiní",value:"1.5%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup na Faerské ostrovy občanský průkaz nestačí. Je potřeba mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup na Faerské ostrovy je potřeba mít platný cestovní pas.",date_update:b},{name:"Vízum",value:"Pro občany Evropské unie není potřeba žádné vízum pro vstup na Faerské ostrovy. Pokud však plánujete pobyt déle než 3 měsíce, může být nutné si zažádat o povolení k pobytu. Pro občany mimo Evropskou unii a Šengenský prostor je často potřeba vízum.",date_update:b},{name:"Očkování",value:"Pro vstup na Faerské ostrovy není nutné mít žádné speciální očkování. Nicméně, jako vždy, je doporučeno být očkován proti běžným chorobám jako jsou tetanus, záškrt, či hepatitida A a B.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup na Faerské ostrovy není nutné mít cestovní ani zdravotní pojištění. Nicméně, vzhledem k tomu, že lékařská péče na Faerských ostrovech může být velmi drahá, doporučuje se mít uzavřeno cestovní pojištění s krytím lékařských nákladů.",date_update:b},{name:"Bezpečnostní situace",value:"Faerské ostrovy jsou obecně považovány za bezpečné místo pro návštěvu. Kriminalita a terorismus jsou na velmi nízké úrovni. Nicméně, při cestování v přírodě je důležité dbát opatrnosti a dodržovat základní bezpečnostní opatření.",date_update:b},{name:"Další informace",value:"Při návštěvě Faerských ostrovů je dobré si vzít s sebou dostatek peněz, jelikož bankomaty jsou poměrně řídké a ne všechny přijímají zahraniční karty. Dále je dobré si přibalit vhodné oblečení a obuv, neboť počasí na ostrovech může být velmi proměnlivé. Většina obyvatel Faerských ostrovů mluví plynně anglicky, takže komunikace by neměla být příliš problémová.",date_update:b}],type_place:i,id_image_cover:g,id_image_hero:g,id_city_main:708,affiliate:[{name:"booking",value:c}],mpz:"FO",alerts:a,zoom:[{google:7,booking:8}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:74,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00"}],imagePlace:[{id:g,name:h,source:"\u002Fworld\u002Fstates\u002F",type:i,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:d,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003EEvropě\u003C\u002Fb\u003E se nachází mnoho zajímavých měst. Například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpariz\"\u003EPaříž\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Flondyn\"\u003ELondýn\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Frim\"\u003EŘím\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbarcelona\"\u003EBarcelona\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpraha\"\u003EPraha\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fberlin\"\u003EBerlín\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Famsterdam\"\u003EAmsterdam\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása \u003Cb\u003EEvropy\u003C\u002Fb\u003E je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. \u003Cb\u003EAlpské hory\u003C\u002Fb\u003E nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba \u003Cb\u003EPlitvická jezera\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fchorvatsko\"\u003EChorvatsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EKrkonošský národní park\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcesko\"\u003EČeské republice\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ENárodní park Durmitor\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcerna-hora\"\u003EČerné Hoře\u003C\u002Fa\u003E\u003C\u002Fb\u003E, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n  \u003Cp\u003EPři návštěvě \u003Cb\u003EEvropy\u003C\u002Fb\u003E si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří \u003Cb\u003Eitalská\u003C\u002Fb\u003E, \u003Cb\u003Efrancouzská\u003C\u002Fb\u003E a \u003Cb\u003Ešpanělská\u003C\u002Fb\u003E. \u003Cb\u003EItalská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpasta\"\u003Etěstovinami\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpizza\"\u003Epizzou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Ezmrzlinou\u003C\u002Fb\u003E. \u003Cb\u003EFrancouzská kuchyně\u003C\u002Fb\u003E nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. \u003Cb\u003EŠpanělská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Ftapas\"\u003Etapas\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpaella\"\u003Epaellou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Esangriou\u003C\u002Fb\u003E. Kromě těchto kuchyní jsou v \u003Cb\u003EEvropě\u003C\u002Fb\u003E také velmi oblíbené pokrmy jako \u003Cb\u003Eněmecké klobásy\u003C\u002Fb\u003E, \u003Cb\u003Eanglické snídaně\u003C\u002Fb\u003E, \u003Cb\u003Eholandský sýr\u003C\u002Fb\u003E a mnoho dalšího.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:d,id_image_hero:d,zoom:[{google:j,booking:j}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00"}]}],fetch:{"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023",true,4,"112",0,244,"faerske-ostrovy","state",3)));